<script setup>
import { ref, computed } from "vue";

import ShinyButton from "./ShinyButton.vue";

const imgCenterBase64 = ref(
  "data:image/webp;base64,",
); // Замените на реальный код
const imgCarouselBase64 = ref(
  "data:image/webp;base64,",
);

// Состояние вращения
const rotation = ref(0);
const isSpinning = ref(false);

const spinDuration = 5000;
// Функция для запуска вращения (например, на 2000 градусов)
const spin = () => {
  if (isSpinning.value) return;
  isSpinning.value = true;

  // 1. Рассчитываем случайный сектор (для примера)
  // Чтобы колесо всегда крутилось вперед, добавляем много оборотов (например 5 * 360)
  const extraSpins = 360 * 8;
  const randomOffset = Math.floor(Math.random() * 360);
  const targetRotation = rotation.value + extraSpins + randomOffset;

  // 2. Запускаем вращение
  rotation.value = targetRotation;

  // 4. Сброс флага после окончания
  setTimeout(() => {
    isSpinning.value = false;
  }, spinDuration);
};



const fontSize = "text-[32px] ";
const segments = [
  { text: "МЕРЧ", type: "gold", style: fontSize + " font-black uppercase" },
  { text: "500 ₽", type: "purple", style: fontSize + " font-black uppercase" },
  {
    text: "+5 К \nКРИПТО\nДЕПУ",
    type: "gold",
    style: fontSize + "font-black leading-tight uppercase",
    multiline: true,
  },
  {
    text: "ПРОМО\nКОД",
    type: "purple",
    style: fontSize + " font-black uppercase leading-none",
    multiline: true,
  },
  { text: "50 ₽", type: "gold", style: fontSize + " font-black uppercase" },
  {
    text: "77 FS",
    type: "purple",
    style: fontSize + " font-black  uppercase",
  },
];

const size = 450;
const center = size + 20;
const radius = 240;
const innerRadius = 80;
const totalSegments = segments.length;
const anglePerSegment = 360 / totalSegments;

// Исправленные координаты (убраны лишние смещения +188 и +11)
const getCoordinatesForPercent = (percent, r) => {
  const x = center + r * Math.cos(2 * Math.PI * percent);
  const y = center + r * Math.sin(2 * Math.PI * percent);
  return [x, y];
};

const getSlicePath = (index) => {
  const startAngle = index * anglePerSegment - 90 - anglePerSegment / 2;
  const endAngle = startAngle + anglePerSegment;
  const startPercent = startAngle / 360;
  const endPercent = endAngle / 360;

  const [startX, startY] = getCoordinatesForPercent(startPercent, radius);
  const [endX, endY] = getCoordinatesForPercent(endPercent, radius);
  const [innerStartX, innerStartY] = getCoordinatesForPercent(
    startPercent,
    innerRadius,
  );
  const [innerEndX, innerEndY] = getCoordinatesForPercent(
    endPercent,
    innerRadius,
  );

  const largeArcFlag = anglePerSegment > 180 ? 1 : 0;

  return `
    M ${startX} ${startY}
    A ${radius} ${radius} 0 ${largeArcFlag} 1 ${endX} ${endY}
    L ${innerEndX} ${innerEndY}
    A ${innerRadius} ${innerRadius} 0 ${largeArcFlag} 0 ${innerStartX} ${innerStartY}
    Z
  `;
};

const getTextTransform = (index) => {
  const angle = index * anglePerSegment - 90;
  const rotation = angle + 90;
  const textRadius = (radius + innerRadius) / 2;
  const [x, y] = getCoordinatesForPercent(angle / 360, textRadius);
  return { x, y, rotation };
};
</script>

<template>
  <div class="text-shadow-2xs absolute top-[190px] leading-[40px] left-[60px] z-[9999] monser font-bold flex flex-col text-white text-[40px]">
    <span class="font-[800] text-[150px] leading-[120px] ">ЛОВИ <br> БОНУС</span>
    <span>от дракона</span>    
  </div>
  <div class="absolute top-1/2 z-[9999]">
    <ShinyButton @click="spin"></ShinyButton>
  </div>
  <div
    class="fixed inset-0 w-screen h-screen overflow-hidden flex flex-col items-center justify-center z-999"
  >
    <div class="relative w-full h-full flex items-center justify-center p-4">
      <svg
        :viewBox="`0 200 ${size} ${size}`"
        class="w-full h-full max-w-[600px] max-h-[600px]"
        preserveAspectRatio="xMidYMid meet"
        style="overflow: visible"
      >
        <defs>
          <linearGradient id="premium-gold" x1="0%" y1="0%" x2="0%" y2="100%">
            <stop offset="0%" stop-color="#F9DB8B" />
            <stop offset="100%" stop-color="#F5CB6E" />
          </linearGradient>

          <linearGradient id="premium-purple" x1="0%" y1="0%" x2="0%" y2="100%">
            <stop offset="0%" stop-color="#E5B8F5" />
            <stop offset="100%" stop-color="#CC8AEB" />
          </linearGradient>

          <linearGradient id="metallic-rim" x1="0%" y1="0%" x2="100%" y2="100%">
            <stop offset="0%" stop-color="#D6D3D1" />
            <stop offset="50%" stop-color="#F5F5F4" />
            <stop offset="100%" stop-color="#D6D3D1" />
          </linearGradient>
          
        </defs>
        <g 
  :class="{ 'wheel-idle': !isSpinning }" 
  :style="{ transformOrigin: `${center}px ${center}px` }"
>
        <g
    :style="{
      transform: `rotate(${rotation}deg)`,
      transformOrigin: `${center}px ${center}px`,
      transition: `transform ${spinDuration}ms cubic-bezier(0.5, 0.1, 0.15, 1)`,
      transitionProperty: 'transform, filter',
      willChange: 'transform, filter',
    }"
  >
          <g>
            <path
              v-for="(segment, index) in segments"
              :key="index"
              :d="getSlicePath(index)"
              :fill="
                segment.type === 'gold'
                  ? 'url(#premium-gold)'
                  : 'url(#premium-purple)'
              "
              stroke="white"
              stroke-width="0.5"
              stroke-opacity="0.1"
            />
          </g>

          <g>
            <template
              v-for="(segment, index) in segments"
              :key="'text-' + index"
            >
              <g
                :transform="`translate(${getTextTransform(index).x}, ${getTextTransform(index).y}) rotate(${getTextTransform(index).rotation})`"
              >
                <text
                  text-anchor="middle"
                  dominant-baseline="middle"
                  :fill="segment.type === 'gold' ? '#E99508' : '#A12BDC'"
                  :class="segment.style"
                  class="select-none tracking-wide"
                >
                  <template v-if="segment.multiline">
                    <tspan
                      v-for="(line, lineIndex) in segment.text.split('\n')"
                      :key="lineIndex"
                      x="0"
                      :dy="lineIndex === 0 ? '-0.5em' : '1em'"
                    >
                      {{ line }}
                    </tspan>
                  </template>
                  <template v-else>{{ segment.text }}</template>
                </text>
              </g>
            </template>
          </g>
        </g>
</g>
        <circle
          :cx="center"
          :cy="center"
          :r="innerRadius"
          fill="none"
          stroke="url(#metallic-rim)"
          stroke-width="8"
        />
        <circle :cx="center" :cy="center" :r="innerRadius - 4" fill="white" />

        <image
          :x="center - 110"
          :y="center - 100"
          width="210"
          height="210"
          :xlink:href="imgCenterBase64"
        />

        <image
          :x="center - size * 1.9 + 560"
          :y="center - size * 1.3 + 210"
          :width="size * 1.8"
          :height="size * 1.8"
          :xlink:href="imgCarouselBase64"
          style="pointer-events: none"
        />
      </svg>
    </div>
  </div>
</template>

<style scoped>
@keyframes idle-swing {
  0% { transform: rotate(-1.5deg); }
  50% { transform: rotate(1.5deg); }
  100% { transform: rotate(-1.5deg); }
}

.wheel-idle {
  /* Важно: ease-in-out делает покачивание мягким */
  animation: idle-swing 4s ease-in-out infinite;
}
path {
  filter: drop-shadow(0 1px 1px rgba(255,255,255,0.15))
          drop-shadow(0 -2px 4px rgba(0,0,0,0.25));
}
</style>
